	add("lapwing", "{\"term\":\"lapwing\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027hleapewince\u0027 from \u0027hleapan\u0027 + \u0027*winc-\u0027 (\u0026quot;sway, totter\u0026quot;) (because of its manner of flight). The modern form is influenced by popular etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several medium-sized wading birds belonging to the subfamily Vanellinae within family Charadriidae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Steven L. Hilty, Bill Brown, \u0027A Guide to the Birds of Colombia\u0027, [http://books.google.com.au/books?id\u003dkHa6tJNKGDAC\u0026amp;pg\u003dPA149\u0026amp;dq\u003d%22lapwings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFqCEUoChI4rukgWfv4DYAQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22lapwings%22\u0026amp;f\u003dfalse page 149\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Plovers and \u0027\u0027lapwings\u0027\u0027 are a large, virtually worldwide family that differs from sandpipers in, among other things, having a shorter, thicker, pigeonlike bill and more robust proportions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Des Thompson, Ingvar Byrkjedal, \u0027Tundra Plovers\u0027, [http://books.google.com.au/books?id\u003dRv_2ulEwYyYC\u0026amp;pg\u003dPA36\u0026amp;dq\u003d%22lapwings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFqCEUoChI4rukgWfv4DYAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22lapwings%22\u0026amp;f\u003dfalse page 36\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The resident tropical plovers have much less pointed wings, and most of the \u0027\u0027lapwings\u0027\u0027 have fairly rounded wing-tips, a wing shape apparently more adapted to aerial manoeuvrability than to long-distance migration\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Clive Finlayson, \u0027Birds of the Strait of Gibraltar\u0027, [http://books.google.com.au/books?id\u003dhjEn-sOGd3oC\u0026amp;pg\u003dPA244\u0026amp;dq\u003d%22lapwings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFqCEUoChI4rukgWfv4DYAQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22lapwings%22\u0026amp;f\u003dfalse page 244\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Lapwings\u0027\u0027 are abundant winter visitors to the area but, like the Golden Plovers, vary greatly in number between years\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A silly man\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027, w:William William Shakespeare, Hamlet\u0027 , Act V Scene 2\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027lapwing\u0027\u0027 runs away with the shell on his head\", \"priority\":13}]}, \"synonyms\":{}}");

